    value: 'This amendment being submitted in response to FEC request letter dated
      6/22/04.  This amendment includes the employer/occupation info which was provided
      in response to our queries.  Following is a restatement of our procedures:  Please
      be advised that the campaign has attempted to obtain the occupations and name
      or employer for all individuals who contributed more than $200 in an election
      cycle.  We send out a letter upon receipt of a contribution missing this information.  In
      the letter we clearly ask for the missing information without soliciting a contribution;
      inform the contributor of the requirements of federal law of the reporting of
      such information and include a pre-addressed envelope.  If information is not
      received in a timely manner we send out a second request for the missing information.  Any
      information that we receive will be amended at a later date or will be a memo
      item in another report.'
